  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents the Camas National
  Wildlife Refuge survey area in Jefferson and Clark County, ID. This bare earth digital
  elevation model (DEM) represent the earth's surface with all vegetation and human-made
  structures removed. The bare earth DEMs were derived from LiDAR data using TIN processing
  of the ground point returns. The DEM grid cell size is 1 meter. The elevation units
  are in meters. Some elevation values have been interpolated across areas in the
  ground model where there is no elevation data (e.g. over water, over dense vegetation).
  Watershed Sciences, Inc. collected the LiDAR and created this data set for the US
  Fish and Wildlife Service.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
